(3, 122, 305, 1620, 'Login', 'USERDEF', '로그인', 'R', 10, 'Y', '	//post 만들기\n	sendFormData = new FormData();\n\n	sendFormData.append(\"REDIS_HOST\",$(\"#G1-REDIS_HOST\").val());\n	sendFormData.append(\"REDIS_PORT\",$(\"#G1-REDIS_PORT\").val());\n	sendFormData.append(\"REDIS_PASSWORD\",$(\"#G1-REDIS_PASSWORD\").val());\n\n	//컨디션 radio, checkbox 만 재지정\n	//GRP SVC LOOP\n\n	$.ajax({\n		type : \"POST\",\n		url : \"../cg_configmng_api.php?CTL=loginRedis&TOKEN=\" + token,\n		data : sendFormData,\n		processData: false,\n		contentType: false,\n		dataType: \"json\",\n		success: function(tdata){\n			alog(tdata);\n			$(\"#G4-LOG\").val( tdata.RTN_MSG + \"\\\\n\" + $(\"#G4-LOG\").val() );\n		},\n		error: function(error){\n			alog(\"Error:\");\n			alog(error);\n		}\n	});', '20200708071939', '20200712101003', 0, NULL),
(3, 122, 305, 1622, 'SearchMaps', 'USERDEF', '키목록 조회', 'R', 10, 'Y', '	//post 만들기\n	sendFormData = new FormData();\n\n	$$(\'wixdtG2\').clearAll();\n\n	$.ajax({\n		type : \"POST\",\n		url : \"../cg_configmng_api.php?CTL=getMapList&TOKEN=\" + token,\n		data : sendFormData,\n		processData: false,\n		contentType: false,\n		dataType: \"json\",\n		success: function(tdata){\n			alog(tdata);\n			$(\"#G4-LOG\").val(tdata.RTN_MSG + \"\\\\n\" + $(\"#G4-LOG\").val());\n			$$(\"wixdtG2\").parse(tdata.RTN_DATA,\"json\");\n			$(\"#spanG2Cnt\").text(tdata.RTN_DATA.length);\n		},\n		error: function(error){\n			alog(\"Error:\");\n			alog(error);\n		}\n	});', '20200708071939', '20200712095004', 0, NULL),
