(122, 3, 63, 'sLoginG', 'login', 9, 'R', 'RTN_SELECT_LIST', 0, 'SELECT\n	LOGIN_SEQ, USR_ID, SESSION_ID, SUCCESS_YN, RESPONSE_MSG\n	, PW_ERR_CNT, LOCKCD, USR_SEQ, SERVER_NAME, REMOTE_ADDR\n	, USER_AGENT, ADD_DT\nFROM CMN_LOG_LOGIN\nWHERE USR_ID = #{USER.ID}\nORDER BY LOGIN_SEQ DESC', 0, '20180423152901', '20200317100838'),
