(125, 3, 65, 'sLgnFailG', 'sLgnFailG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT USR_ID, count(LOGIN_SEQ) as LOGIN_CNT \nFROM CMN_LOG_LOGIN\nWHERE SUCCESS_YN = \'N\'\nGROUP by USR_ID ORDER BY count(login_seq) desc', NULL, '20180511142644', NULL),
(126, 3, 65, 'sLgnIpG', 'sLgnIpG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT REMOTE_ADDR, count(LOGIN_SEQ) as LOGIN_CNT \nFROM CMN_LOG_LOGIN\nWHERE SUCCESS_YN = \'N\'\nGROUP by REMOTE_ADDR ORDER BY count(login_seq) desc', NULL, '20180511142716', NULL),
(127, 3, 65, 'sAuthNoG', 'sAuthNoG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT USR_ID,count(LAUTH_SEQ) as AUTH_CNT\nFROM `CMN_LOG_AUTH` \nWHERE SUCCESS_YN = \'N\'\nGROUP BY USR_ID\nORDER BY count(LAUTH_SEQ) desc', NULL, '20180511142741', NULL),
