(390, 3, 92, 'insIoF', 'insIoF', 3, 'C', 'RTN_INT', 4, 'insert into CG_PGMIO\n(\n	PJTSEQ, PGMSEQ, GRPSEQ, COLORD, COLID\n	, COLNM, DATATYPE, VALIDSEQ, DATASIZE, OBJTYPE\n	, POPUP, KEYYN, SEQYN, LBLHIDDENYN, LBLWIDTH\n	, LBLALIGN, OBJWIDTH, OBJHEIGHT, OBJALIGN, HIDDENYN\n	, EDITYN, FNINIT, BRYN, FORMAT, FOOTERMATH\n	, FOOTERNM, ICONNM, ICONSTYLE, LBLSTYLE, OBJSTYLE\n	, OBJ2STYLE\n	, ADDID, ADDDT\n) values (\n	#{G1-PJTSEQ}, #{G1-PGMSEQ}, #{G1-GRPSEQ}, #{G3-COLORD}, #{G3-COLID}\n	, #{G3-COLNM}, #{G3-DATATYPE}, #{G3-VALIDSEQ}, #{G3-DATASIZE}, #{G3-OBJTYPE}\n	, #{G3-POPUP}, #{G3-KEYYN}, #{G3-SEQYN}, #{G3-LBLHIDDENYN}, #{G3-LBLWIDTH}\n	, #{G3-LBLALIGN}, #{G3-OBJWIDTH}, #{G3-OBJHEIGHT}, #{G3-OBJALIGN}, #{G3-HIDDENYN}\n	, #{G3-EDITYN}, #{G3-FNINIT}, #{G3-BRYN}, #{G3-FORMAT}, #{G3-FOOTERMATH}\n	, #{G3-FOOTERNM}, #{G3-ICONNM}, #{G3-ICONSTYLE}, #{G3-LBLSTYLE}, #{G3-OBJSTYLE}\n	, #{G3-OBJ2STYLE}\n	, #{USER.SEQ}, date_format(sysdate(),\'%Y%m%d%H%i%s\')\n)\n', 0, '20190917071346', '20190917071805'),
(391, 3, 92, 'updIoF', 'updIoF', 3, 'U', 'RTN_INT', 5, 'update CG_PGMIO set\n	COLORD = #{G3-COLORD}, COLID = #{G3-COLID}, COLNM = #{G3-COLNM}, DATATYPE = #{G3-DATATYPE}, VALIDSEQ = #{G3-VALIDSEQ}\n	, DATASIZE = #{G3-DATASIZE}, OBJTYPE = #{G3-OBJTYPE}, POPUP = #{G3-POPUP}, KEYYN = #{G3-KEYYN}, SEQYN = #{G3-SEQYN}\n	, LBLHIDDENYN = #{G3-LBLHIDDENYN}, LBLWIDTH = #{G3-LBLWIDTH}, LBLALIGN = #{G3-LBLALIGN}, OBJWIDTH = #{G3-OBJWIDTH}, OBJHEIGHT = #{G3-OBJHEIGHT}\n	, OBJALIGN = #{G3-OBJALIGN}, HIDDENYN = #{G3-HIDDENYN}, EDITYN = #{G3-EDITYN}, FNINIT = #{G3-FNINIT}, BRYN = #{G3-BRYN}\n	, FORMAT = #{G3-FORMAT}, FOOTERMATH = #{G3-FOOTERMATH}, FOOTERNM = #{G3-FOOTERNM}, ICONNM = #{G3-ICONNM}, ICONSTYLE = #{G3-ICONSTYLE}\n	, LBLSTYLE = #{G3-LBLSTYLE}, OBJSTYLE = #{G3-OBJSTYLE}, OBJ2STYLE = #{G3-OBJ2STYLE}\n	, MODID = #{USER.SEQ}, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere PJTSEQ = #{G3-PJTSEQ} and PGMSEQ = #{G3-PGMSEQ} and GRPSEQ = #{G3-GRPSEQ} and IOSEQ = #{G3-IOSEQ}\n', 0, '20190917071346', '20190917072856'),
(392, 3, 100, 'selG', 'selG', 7, 'R', 'RTN_SELECT_LIST', 1, 'select LOGSEQ, URL, SESSIONID, REQTOKEN, RESTOKEN, USERID, USERSEQ, LISTNM, LOGLEVEL, LOGDT, LOGMSG, CHANNEL, ADDDT\nfrom CG_MONOLOG\nwhere ADDDT >= concat(replace(#{G1-ADDDT},\'.\',\'\'),\'000000\')\n	and ADDDT <= concat(replace(#{G1-ADDDT},\'.\',\'\'),\'235959\')\n	and\n	case when length(#{G1-LISTNM}) > 0 \n		then LISTNM like concat(\'%\',#{G1-LISTNM},\'%\')\n		else 1=1\n	end and\n	case when length(#{G1-LOGLEVEL}) > 0 \n		then LOGLEVEL like concat(\'%\',#{G1-LOGLEVEL},\'%\')\n		else 1=1\n	end and\n	case when length(#{G1-LOGMSG}) > 0 \n		then LOGMSG like concat(\'%\',#{G1-LOGMSG},\'%\')\n		else 1=1\n	end and\n	case when length(#{G1-CHANNEL}) > 0 \n		then CHANNEL like concat(\'%\',#{G1-CHANNEL},\'%\')\n		else 1=1\n	end\norder by LOGSEQ desc\n', 0, '20191118102414', '20200227071804'),
(393, 3, 100, 'selF', 'selF', 7, 'R', 'RTN_SELECT_ONE', 1, 'select LOGSEQ, URL, SESSIONID, REQTOKEN, RESTOKEN, USERID, USERSEQ, LISTNM, LOGLEVEL, LOGDT, LOGMSG, \'webed\' as LOGWE, CHANNEL, ADDDT\nfrom CG_MONOLOG\nwhere  LOGSEQ = #{G2-LOGSEQ}\n', 0, '20191118181716', '20200310061924'),
(396, 3, 102, 'lstPjt', 'lstPjt', 3, 'R', 'RTN_SELECT_LIST', 10, 'select\n	PJTSEQ,PJTID,PJTNM,FILECHARSET,UITOOL\n	,SVRLANG,DEPLOYKEY,PKGROOT,STARTDT,ENDDT\n	,DELYN,ADDDT,MODDT \nfrom\n CG_PJTINFO	\nwhere DELYN = \'N\'\n', 0, '20200209211154', '20200209211411'),
(397, 3, 102, 'dtlPjt', 'dtlPjt', 3, 'R', 'RTN_SELECT_ONE', 20, 'select\n	PJTSEQ,PJTID,PJTNM,FILECHARSET,UITOOL\n	,SVRLANG,DEPLOYKEY,PKGROOT,STARTDT,ENDDT\n	,DELYN\n	,concat(#{CFG.CFG_MAKE_URL},\'/m.k/cg_cdeploy?PJTID=\',PJTID,\'&CTL=INIT\', \'^GIT 초기화\') as GITINIT\n	,concat(#{CFG.CFG_MAKE_URL},\'/m.k/cg_cdeploy?PJTID=\',PJTID,\'&CTL=COMMIT&MSG=Auto\', \'^GIT 커밋\') as GITCOMMIT\n	,concat(#{CFG.CFG_MAKE_URL},\'/m.k/cg_cdeploy?PJTID=\',PJTID,\'&CTL=PUSH\', \'^GIT 푸쉬\') as GITPUSH\n	,concat(#{CFG.CFG_MAKE_URL},\'/m.k/cg_cdeploy?PJTID=\',PJTID,\'&CTL=FORCE_PUSH\', \'^GIT 강제푸쉬\') as GITFORCEPUSH\n	,concat(#{CFG.CFG_MAKE_URL},\'/m.k/cg_cdeploy?PJTID=\',PJTID,\'&CTL=VIEW_CONFIG\', \'^GIT 설정보기\') as GITVIEWCONFIG\n	,ADDDT,MODDT \nfrom\n CG_PJTINFO	\nwhere PJTSEQ = #{G2-PJTSEQ}\n', 0, '20200209211411', '20200210072147'),
(398, 3, 103, 'lstTable', 'lstTAble', 7, 'R', 'RTN_SELECT_LIST', 10, 'SELECT\n0 as CHK,TABLE_SCHEMA, TABLE_NAME\n,concat(\'SQL파일생성^\',#{CFG.CFG_CGWEB_URL},\'/c.g/cg_cdeploy_db.php?DB=\', TABLE_SCHEMA , \'&TABLE=\' , TABLE_NAME , \'^_blank\') as SQLCRATE\n,\'\' as RESULT\n,ENGINE,TABLE_ROWS,AUTO_INCREMENT\n,CREATE_TIME,UPDATE_TIME,TABLE_COLLATION,TABLE_COMMENT \nFROM information_schema.TABLES \nwhere TABLE_SCHEMA =  #{G1-DB}\n', 0, '20200210081157', '20200217215951'),
(399, 3, 103, 'dtlTable', 'dtlTable', 7, 'R', 'RTN_SELECT_ONE', 20, 'SELECT\nTABLE_SCHEMA, TABLE_NAME,ENGINE,TABLE_ROWS,AUTO_INCREMENT\n,CREATE_TIME,UPDATE_TIME,TABLE_COLLATION,TABLE_COMMENT \nFROM information_schema.TABLES \nwhere TABLE_SCHEMA =  #{G1-DB} and TABLE_NAME = #{G2-TABLE_NAME}\n', 0, '20200210081819', '20200217215951'),
(400, 3, 100, 'insF', 'insF', 4, 'C', 'RTN_INT', 1, 'insert into TEST (AA,BB,CC,DD)\nvalues(\n	99,#{G3-LOGMSG},\'aa\', date_format(sysdate(),\'%Y%m%d%H%i%s\')\n)\n', 0, '20200222172702', '20200308231803'),
(401, 3, 104, 'sAuthG', 'AUTH', 7, 'R', 'RTN_SELECT_LIST', 0, '  SELECT \n 		0 as CHK\n		, concat(p.PGMID,\'-\',g.GRPID,\'_\',f.FNCID) as ROWID\n      ,p.PGMID \n      ,concat(g.GRPID,\'_\',f.FNCID) as AUTH_ID\n      ,concat(g.GRPNM,\'_\',f.FNCNM) as AUTH_NM \n	  ,f.ADDDT\n  FROM \n      CG_PGMGRP g\n      JOIN CG_PGMFNC f on g.GRPSEQ = f.GRPSEQ and g.PGMSEQ = f.PGMSEQ\n      JOIN CG_PGMINFO p on p.PGMSEQ = g.PGMSEQ\n  WHERE p.PJTSEQ = #{G1-PJTSEQ} AND ( f.FNCTYPE != \'\' && f.FNCTYPE is not null )\n      order by p.PGMID,g.GRPORD asc,f.FNCORD asc  \n', 0, '20200228070832', '20200301112246'),
(403, 3, 104, 'sPgmG', 'PGM', 7, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n        0 as CHK, PGMSEQ, PGMID, PGMNM, PKGGRP, VIEWURL, PGMTYPE, SECTYPE, ADDDT, MODDT\n    FROM \n        CG_PGMINFO\n    WHERE PJTSEQ = #{G1-PJTSEQ}\n', 0, '20200228070832', '20200229131142'),
(404, 3, 104, 'sSvcMenuG', 'SVCMENU', 9, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n	MNU_SEQ, MNU_NM, PGMID, URL, PGMTYPE\n	, MNU_ORD, USE_YN, ADD_DT, ADD_ID\n	,MOD_DT, MOD_ID  \nFROM CMN_MNU', 0, '20200229105654', '20200726141301'),
(405, 3, 104, 'sSvcAuthG', 'SVCAUTH', 9, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n	AUTH_SEQ, PGMID, AUTH_ID, AUTH_NM, USE_YN\n	, ADD_DT, MOD_DT \nFROM CMN_AUTH\n', 0, '20200229105915', '20200229105938'),
(406, 3, 104, 'insSvcPgmG', 'insSvcPgm', 9, 'U', 'RTN_INT', 0, 'insert into CMN_MNU (\n	MNU_NM, PGMID, URL, PGMTYPE, MNU_ORD\n	, USE_YN, ADD_DT, ADD_ID\n)\nselect \n	#{PGMNM} as MNU_NM, #{PGMID} as PGMID, #{VIEWURL} as URL, #{PGMTYPE} as PGMTYPE, 10 as MNU_ORD\n	, \'Y\' as USE_YN, date_format(sysdate(),\'%Y%m%d%H%i%s\') as ADD_DT, 0 as ADD_ID\nfrom CMN_MNU\nwhere \n 0 =  ( select count(MNU_SEQ)  from CMN_MNU where PGMID = #{PGMID} )\nlimit 1', 0, '20200301101547', '20200726141252'),
(409, 3, 104, 'insSvcAuth', 'insSvcAuth', 9, 'U', 'RTN_INT', 1, 'insert into CMN_AUTH (\n	PGMID, AUTH_ID, AUTH_NM, USE_YN\n	,ADD_DT\n)\nselect \n	#{PGMID} as PGMID, #{AUTH_ID} as AUTH_ID, #{AUTH_NM} as AUTH_NM, \'Y\' as USE_YN\n	, date_format(sysdate(),\'%Y%m%d%H%i%s\') as ADD_DT\nfrom CMN_MNU\nwhere \n 0 =  ( select count(MNU_SEQ)  from CMN_AUTH where PGMID = #{PGMID} and AUTH_ID = #{AUTH_ID})\nlimit 1', 0, '20200301111835', NULL),
